          const minMaxFilterEditor = function (cell, onRendered, success, cancel, editorParams) {
    
          let end;
    
          const container = document.createElement("span");
    
          //create and style inputs
          const start = document.createElement("input");
          start.setAttribute("type", "number");
          start.setAttribute("placeholder", "Min");
          start.style.padding = "4px";
          start.style.width = "50%";
          start.style.boxSizing = "border-box";
    
          start.value = cell.getValue();
    
          function buildValues() {
            success({
              start: start.value,
              end: end.value,
            });
          }
    
          function keypress(e) {
            if (e.keyCode == 13) {
              buildValues();
            }
    
            if (e.keyCode == 27) {
              cancel();
            }
          }
    
          end = start.cloneNode();
          end.setAttribute("placeholder", "Max");
    
          start.addEventListener("change", buildValues);
          start.addEventListener("blur", buildValues);
          start.addEventListener("keydown", keypress);
    
          end.addEventListener("change", buildValues);
          end.addEventListener("blur", buildValues);
          end.addEventListener("keydown", keypress);
    
    
          container.appendChild(start);
          container.appendChild(end);
    
          return container;
        }
    
        //custom max min filter function
        function minMaxFilterFunction(headerValue, rowValue, rowData, filterParams) {
          //headerValue - the value of the header filter element
          //rowValue - the value of the column in this row
          //rowData - the data for the row being filtered
          //filterParams - params object passed to the headerFilterFuncParams property
    
          if (rowValue) {
            if (headerValue.start != "") {
              if (headerValue.end != "") {
                return rowValue >= headerValue.start && rowValue <= headerValue.end;
              } else {
                return rowValue >= headerValue.start;
              }
            } else {
              if (headerValue.end != "") {
                return rowValue <= headerValue.end;
              }
            }
          }
    
          return true; //must return a boolean, true if it passes the filter.
        }
    
        // Function to check if all checkboxes are selected
        function areAllCheckboxesSelected() {
          const checkboxes = document.querySelectorAll(".select-checkbox");
          return Array.from(checkboxes).every(function (checkbox) {
            return checkbox.checked;
          });
        }
    
        // Function to check if no checkboxes are selected
        function areNoCheckboxesSelected() {
          const checkboxes = document.querySelectorAll(".select-checkbox");
          return Array.from(checkboxes).every(function (checkbox) {
            return !checkbox.checked;
          });
        }
    
        // Function to enable/disable buttons based on checkbox status
        function updateButtonStatus() {
          const exportSelectedBtn = document.getElementById("exportSelectedBtn");
          const selectAllBtn = document.getElementById("selectAllBtn");
          const unselectAllBtn = document.getElementById("unselectAllBtn");
    
          const checkboxes = document.querySelectorAll(".select-checkbox");
          const selectedCheckboxes = Array.from(checkboxes).filter(function (checkbox) {
            return checkbox.checked;
          });
    
          exportSelectedBtn.disabled = selectedCheckboxes.length === 0;
          selectAllBtn.disabled = areAllCheckboxesSelected();
          unselectAllBtn.disabled = areNoCheckboxesSelected();
        }
    
    
        document.getElementById("selectAllBtn").addEventListener("click", function () {
          const checkboxes = document.querySelectorAll(".select-checkbox");
          checkboxes.forEach(function (checkbox) {
            checkbox.checked = true;
          });
          updateButtonStatus();
        });
    
    
        document.getElementById("exportSelectedBtn").addEventListener("click", function () {
        const selectedIds = [];
        const checkboxes = document.querySelectorAll(".select-checkbox:checked");
        checkboxes.forEach(function (checkbox) {
            selectedIds.push(parseInt(checkbox.id));
        });
    
        console.log(selectedIds);
    
        
        var selectedRowsData = selectedIds.map(function (position) {
            if (position >= 0 && position < testResults.perfomanceSummary.length) {
              return testResults.perfomanceSummary[position];
            } else {
              // If position is out of range, return null or handle it as needed
              return null;
            }
          });

          // Filter out null values if needed
          selectedRowsData = selectedRowsData.filter(function (summary) {
            return summary !== null;
          })

          const csvResult = convertResultsToCSV(selectedRowsData);
          saveAs(csvResult, fileName);
        });
    
        document.getElementById("unselectAllBtn").addEventListener("click", function () {
          const checkboxes = document.querySelectorAll(".select-checkbox");
          checkboxes.forEach(function (checkbox) {
            checkbox.checked = false;
          });
          updateButtonStatus();
    
        });
        
        window.onload = function () {
          const checkboxes = document.querySelectorAll(".select-checkbox");
          checkboxes.forEach(function (checkbox) {
            checkbox.addEventListener("click", updateButtonStatus);
          });
    
           // Enable the Select All button initially
          updateButtonStatus();
        };

    const firstObject = performanceSummaryForHtml[0]; // We only need the first array of the list of data
    const keys = Object.keys(firstObject);
    
    const columns = keys.map(key => {

    function convertResultsToCSV (data) {
            const testResults = {
                perfomanceSummary: [],
                };
    
        testResults.perfomanceSummary = data;

        if (!testResults || !testResults.perfomanceSummary || !testResults.perfomanceSummary.length)
            return 'There is no data for conversion'
        let headers = Object.keys(testResults.perfomanceSummary[0]) // The first test table can be with error and can't have rows with previous values when parsedReport
        if (testResults.hasOwnProperty('paramsNames') && headers.length <= (Object.keys(testResults.paramsNames).length + 1)) { // Find the another header if only params names and 'comment' in headers
            const headersAll = testResults.perfomanceSummary.find(report => Object.keys(report).length > headers.length)
            if (headersAll)
                headers = Object.keys(headersAll)
        }
        
        headers = headers.reduce(function (csvHeader, header) {
            if (!header.includes("Discord") && !header.includes("discord") && !header.startsWith("Telegram") && !header.startsWith("__API") && !header.startsWith("Email Address")) {
                csvHeader.push(header);
            }
            return csvHeader;
        }, []);
        
        let csv = headers.map(header => JSON.stringify(header)).join(',')
        csv += '\n'

        for (const row of testResults.perfomanceSummary) {
            // const rowData = headers.map(key => typeof row[key] !== 'undefined' ? JSON.stringify(row[key]) : '')
            const rowData = headers.map(key => typeof row[key] === 'undefined' ? '' : prepareCSVOut(row[key], key))
            csv += rowData.join(',').replaceAll('\\"', '""')
            csv += '\n'
        }
        if (testResults.filteredSummary && testResults.filteredSummary.length) {
            csv += headers.map(key => key !== 'comment' ? '' : 'Bellow filtered results of tests') // Empty line
            csv += '\n'
            for (const row of testResults.filteredSummary) {
                // const rowData = headers.map(key => typeof row[key] !== 'undefined' ? JSON.stringify(row[key]) : '')
                const rowData = headers.map(key => typeof row[key] === 'undefined' ? '' : prepareCSVOut(row[key], key))
                csv += rowData.join(',').replaceAll('\\"', '""')
                csv += '\n'
            }
        }
        return csv
    }


      function prepareCSVOut(value, key = '') {
          if (!value)
              return 0
          if (typeof value !== 'number')
              return JSON.stringify(value)
          // if (key && key.includes('%'))
          //   return  (value * 100).toFixed(5) // * 100
          return (Math.round(value * 100) / 100).toFixed(2)
          // return (value * 10).toFixed(2)/10
      }
      
      function saveAs(text, suggestedFileName) {
        // Prompt the user for a file name
        const filename = window.prompt("Enter file name:", suggestedFileName);
    
        // If user provides a file name, create a download link
        if (filename) {
            let aData = document.createElement('a');
            aData.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(text));
            aData.setAttribute('download', filename);
            aData.style.display = 'none'; // Hide the link
            document.body.appendChild(aData);
            aData.click();
            document.body.removeChild(aData);
        }
}
